import Cart from "./Cart";
import Button from "./Button";
import classes from "./ErrorModal.module.css"

const ErrorModal = (props) => {

    return (
        <Cart className={classes.modal}>
            <header>
                <h2>{props.title}</h2>
            </header>
            <div>
                <p>{props.message}</p>
            </div>
            <footer>
                <Button>Okay</Button>
            </footer>
        </Cart>
    )
}

export default ErrorModal;
